import React from 'react';
import {
  Button, Dialog, DialogActions, DialogContent, DialogTitle, Typography
} from '@material-ui/core';

import { Block } from '../../utils/eosio';

export interface BlockDialogProps {
  open: boolean;
  selectedValue: Block | null;
  onClose: () => void;
}

function BlockDialog(props: BlockDialogProps) {
  const { onClose, selectedValue, open } = props;

  return (
    selectedValue &&
    <Dialog data-test-id='block-dialog' aria-labelledby='simple-dialog-title' { ...{ open, onClose } }>
      <DialogTitle id='simple-dialog-title'>Block Data</DialogTitle>
      <DialogContent>
        <pre>
          {JSON.stringify(selectedValue, null, 2)}
        </pre>
      </DialogContent>
      <DialogActions>
        <Button data-test-id='block-dialog-close' onClick={onClose} color='primary'>
          <Typography>Close</Typography>
        </Button>
      </DialogActions>
    </Dialog>
  );
}

export default BlockDialog;

import { expect } from 'chai';
import { mount } from 'enzyme';
import * as React from 'react';

import BlockTable from '.';
import { getTopTenBlocks, Block } from '../../utils/eosio';

const blockTableProps: { rows: Array<Block>, cols: Array<string> } = {
  rows: [],
  cols: [
    'id',
    'timestamp',
    'actionsCount'
  ]
};

const wrapper = mount(<BlockTable { ...blockTableProps } />);

describe('BlockTable Component', () => {

  describe('base state', () => {
    it('should contain one row in the table', () => {
      expect(wrapper.find('tr').length).to.eq(1);
    });
  });

  describe('after API calls to EOS.IO blockchain', () => {
    before(done => {
      getTopTenBlocks()
      .then((_blocks: Array<Block>) => {
        wrapper.setState({
          rows: _blocks
        });
        done();
      });
    });

    it('should contain 11 rows in the table', () => {
      wrapper.update();
      expect(wrapper.find('tr').length).to.equal(11);
    });

    it('should click the first row with data in the table to open the BlockDialog', () => {
      wrapper.find("tr[data-test-id='block-table-0']").simulate('click');
      wrapper.update();
      expect(wrapper.state('showDialog')).to.eq(true);
    });

    it('should close the BlockDialog', () => {
      wrapper.find("button[data-test-id='block-dialog-close']").simulate('click');
      wrapper.update();
      expect(wrapper.state('showDialog')).to.eq(false);
      wrapper.unmount();
    });
  });
});

import React from 'react';

import {
  Container, Paper, Table, TableBody, TableCell, TableHead, TableRow, Typography
} from '@material-ui/core';

import { Block } from '../../utils/eosio';
import BlockDialog from '../BlockDialog';

type BlockTableProps = {
  rows: any[];
  cols: any[];
};

type BlockTableType = {
  showDialog: boolean;
  selectedValue: Block | null;
} & BlockTableProps;

class BlockTable extends React.Component<BlockTableProps, BlockTableType> {
  constructor(props: BlockTableProps) {
    super(props);

    this.state = {
      ...props,
      showDialog: false,
      selectedValue: null
    };

    this.dialogOpen = this.dialogOpen.bind(this);
    this.dialogClose = this.dialogClose.bind(this);
  }

  dialogOpen = (row: Block) => {
    this.setState({
      showDialog: true,
      selectedValue: row
    });
  }

  dialogClose = () => {
    this.setState({
      showDialog: false
    });
  }

  render() {
    const {
      cols,
      rows,
      showDialog,
      selectedValue
    } = this.state;

    return (
      <Container>
        <Paper className='data-table-container'>
          <Table className='data-table' aria-label='simple table'>
            <TableHead>
              <TableRow>
                {cols && cols.map(col => (
                  <TableCell align='right' key={col}>
                    {col}
                  </TableCell>
                ))}
              </TableRow>
            </TableHead>
            <TableBody>
              {rows && rows.map((row, index) => (
                <TableRow data-test-id={`block-table-${index}`} key={row.id} onClick={() => this.dialogOpen(row)}>
                  {cols.map(col => (
                    <TableCell align='right' key={`${row.id}-${row[col]}`}>
                      <Typography>{row[col]}</Typography>
                    </TableCell>
                  ))}
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </Paper>
        <BlockDialog open={showDialog} onClose={this.dialogClose} { ...{ selectedValue }} />
      </Container>
    );
  }
}

export default BlockTable;

import axios, { AxiosResponse } from 'axios';
import { pathOr, propOr, isNil } from 'ramda';

type ActionAuthorization = {
  actor: string,
  permission: string
}

type ActionData = {
  from: string,
  to: string,
  quantity: string,
  memo: string
}

type Action = {
  account: string,
  name: string,
  authorization: Array<ActionAuthorization>,
  data: ActionData,
  hex_data: string
};

type TRXTransaction = {
  expiration: string,
  ref_block_num: number,
  ref_block_prefix: number,
  max_net_usage_words: number,
  max_cpu_usage_ms: number,
  delay_sec: number,
  context_free_actions: Array<any>
  actions: Array<Action>,
  transaction_extensions: Array<any>
};

type BlockTransaction = {
  status: string,
  cpu_usage_us: number,
  net_usage_words: number,
  trx: {
    id: string,
    signatures: Array<string>,
    compression: string,
    packed_context_free_data: string,
    context_free_data: Array<any>,
    packed_trx: string,
    transaction: TRXTransaction
  }
};

export type Block = {
  timestamp: string,
  producer: string,
  confirmed: number,
  previous: string,
  transaction_mroot: string,
  action_mroot: string,
  schedule_version: number,
  new_producers: string | null,
  header_extensions: Array<string>,
  producer_signature: string,
  transactions: Array<BlockTransaction>,
  block_extensions: Array<any>,
  id: string,
  block_num: number,
  ref_block_prefix: number,
  actionsCount: number
};

export const getBlockActions = (block: Block): Array<Action> => {
  let actions: Array<Action> = [];

  for (let i = 0, l = block.transactions.length; i < l; i++) {
    const transaction = block.transactions[i];
    const trxTransaction: TRXTransaction = pathOr({} as TRXTransaction, ['trx', 'transaction'], transaction);

    trxTransaction && trxTransaction.actions && actions.push(...trxTransaction.actions);
  }

  return actions;
};

const getHeadBlockId = () =>
  axios.get('https://api.eosnewyork.io/v1/chain/get_info')
  .then(pathOr('', ['data', 'last_irreversible_block_id']));

const getBlockById = (blockId: string) =>
  axios.post('https://api.eosnewyork.io/v1/chain/get_block', {
    block_num_or_id: blockId
  })
  .then((result: AxiosResponse<any>) => {
    const data = pathOr({} as Block, ['data'], result);
    const block: Block = {
      ...data,
      actionsCount: getBlockActions(data).length
    };

    return block;
  });

const getPreviousBlock = (block: Block): Promise<Block> => getBlockById(propOr({}, 'previous', block));

const getHeadBlock = () =>
  getHeadBlockId()
  .then(getBlockById);

// Recursively retrieve the latest 10 blocks on the blockchain
export const getTopTenBlocks = (blockArray: Array<Block> = [], block?: Block): any =>
  new Promise((resolve, reject) => {
    const blockLimit = 10;

    if (blockArray.length === blockLimit) {
      return resolve(blockArray);
    } else if (blockArray.length === 0 && isNil(block)) {
      return resolve(getHeadBlock()
        .then(headBlock => {
          return getTopTenBlocks(blockArray, headBlock).catch(reject);
        })
        .catch(reject));
    } else if (block) {
      return resolve(getPreviousBlock(block)
      .then(previousBlock => {
        blockArray.push(block);
        return getTopTenBlocks(blockArray, previousBlock).catch(reject);
      })
      .catch(reject));
    }
  });

