import * as React from 'react';

import { isEmpty } from 'ramda';
import {
  Button, CircularProgress, Container, Grid, Typography
} from '@material-ui/core';
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';


import { getTopTenBlocks, Block } from '../../utils/eosio';
import BlockTable from '../BlockTable';

type HomePageType = {
  blocks: Array<Block>;
  loading: boolean;
};

class HomePage extends React.Component<{}, HomePageType> {
  constructor(props: any) {
    super(props);

    this.state = {
      blocks: [],
      loading: false
    };

    this.handleClick = this.handleClick.bind(this);
  }

  handleClick() {
    this.setState({
      loading: true
    });

    return getTopTenBlocks()
    .then((blocks: Array<Block>) => {
      this.setState({
        blocks,
        loading: false
      });
    })
    .catch(console.log);
  }

  render() {
    const {
      blocks,
      loading
    } = this.state;

    return(
      <Container
        className='home-page-container'
      >
        <Grid
          container
          direction='column'
          justify='center'
          alignItems='center'
        >
          <h1>EOS.IO</h1>
          <Button
            className='load-button'
            color='primary'
            variant='contained'
            value='LOAD'
            disabled={loading}
            onClick={this.handleClick}
          >
            <Typography>LOAD</Typography>
          </Button>
        </Grid>
        <Grid
          container
          direction='column'
          justify='center'
          alignItems='center'
          className='block-table-grid'
        >
          {loading
          ? <MuiThemeProvider><CircularProgress /></MuiThemeProvider>
          : !isEmpty(blocks) && <div className='block-table-container'>
            <BlockTable
              rows={blocks}
              cols={[
                'id',
                'timestamp',
                'actionsCount'
              ]}
            />
          </div>}
        </Grid>
      </Container>
    );
  }
}

export default HomePage;

import { assert, expect } from 'chai';

import { getTopTenBlocks, Block } from './eosio';

describe('Utilities', () => {
  describe('eosio', () => {
    let blocks: Array<Block> = [];

    describe('getTopTenBlocks', () => {
      before(done => {
        getTopTenBlocks()
        .then((_blocks: Array<Block>) => {
          blocks = _blocks;
          done();
        });
      });

      it('should always resolve an array', () => {
        assert.isArray(blocks);
      });

      it('should always resolve the top 10 blocks in the blockchain', () => {
        expect(blocks).to.have.lengthOf(10);
      });

      it('should always resolve blocks with at least an id', () => {
        for (let i = 0, l = blocks.length; i < l; i++) {
          let block = blocks[i];

          assert.exists(block.id);
        }
      });

      it('should always contain at least on action', () => {
        let actionsCount = 0;

        for (let i = 0, l = blocks.length; i < l; i++) {
          let block = blocks[i];

          actionsCount += block.actionsCount;
        }

        expect(actionsCount).gt(0);
      });
    });
  });
});
